const Dive = ({ dive }) => {

  if (!dive) {
    return null
}
  const date = new Date(dive.date).toLocaleString('en-GB', {weekday:'short', hour: '2-digit', minute: '2-digit' })
  const end = new Date(dive.endTime).toLocaleTimeString('en-GB', { hour: '2-digit', minute: '2-digit' })

  return (
      <div className="dive">
          <h3>Dive {dive.diveNum}</h3>
          <h3>{date} - {end}</h3>
          <p>{dive.notes}</p>
      </div>
  )
}

export default Dive
